import "../../scss/index_description1.scss";

class Index_description1 extends Component {
  render() {
    return (
      <div>
        <div className="opis1">
          Lorem ipsum dolor, sit amet consectetur adipisicing elit. Ullam cum
          laboriosam, repellendus sint accusamus molestias deleniti ratione. Eos
          incidunt mollitia eligendi officia vel illo quod eius quasi inventore!
          Perspiciatis, beatae!Amet optio cumque labore commodi aliquam, id aut
          eligendi alias, explicabo nihil dignissimos ullam odio animi quisquam
          expedita, accusantium delectus quas atque ea maxime. Maiores officia
          laboriosam exercitationem officiis fugiat?
        </div>
      </div>
    );
  }
}

export default Index_description1;
